import { Component } from 'react';

import './app-filter.css';

class AppFilter extends Component {


    render() {

        return(
            <div className="btn-group">
                <button 
                    className="btn btn-light"
                    type="button">
                        Все чуваки
                </button>
                <button 
                    className="btn btn-outline-light"
                    type="button"
                    onClick={this.props.onIncreaseUp}>
                        Претенденты на печеньку
                </button>
                <button 
                    className="btn btn-outline-light"
                    type="button"
                    onClick={this.props.onSalaryUp}>
                        З/П больше 1000$
                </button>
            </div>
        );
    }
}

export default AppFilter;
